import './ExpenseItemDisplay.css';
import ExpenseItem from './ExpenseItem';
import Card from '../UI/Card'
import ExpensesFilter from "./ExpensesFilter";



const ExpenseItemDisplay = (props) => {
  // const [enteredYear, setEnteredYear]= useState(" ");
  const selectedNewyear = (selectedYearFinal) => {

    console.log(selectedYearFinal);
  };

  return (
    <div>
    <ExpensesFilter onSelectNewYear = {selectedNewyear}/>
    <Card className='expenses'>
      <ExpenseItem
        title = {props.item[0].title}
        amount = {props.item[0].amount}
        date = {props.item[0].date}
      />
      <ExpenseItem
        title = {props.item[1].title}
        amount = {props.item[1].amount}
        date = {props.item[1].date}
      />

    </Card>
    </div>
  );
}

export default ExpenseItemDisplay;
